import React from 'react'
import { Provider } from 'react-native-paper'
import { NavigationContainer } from '@react-navigation/native'
import { createStackNavigator } from '@react-navigation/stack'
import { theme } from '../jeffv2/core/theme'
import {Home}  from '../jeffv2/screens/Home'

const Stack = createStackNavigator()

export default function App() {
  return (
    <Provider theme={theme}>
      <NavigationContainer>
        <Stack.Navigator
          initialRouteName="StartScreen"
          screenOptions={{
            headerShown: false,
          }}
        >       
           <Stack.Screen name="StartScreen" component={Home} />

          <Stack.Screen name="LoginScreen" component={Login_Screen} />
          <Stack.Screen name="Register" component={Register_Screen} />

        </Stack.Navigator>
      </NavigationContainer>
    </Provider>
  )
}
